import React from "react";
import styled from "styled-components";
import { PagesWrap } from "../styles/Template";

const MainPage = () => {
  return (
    <PagesWrap>
      <h1 style={{ fontSize: "3rem" }}>산리오 캐릭터 키링 뽑기</h1>
      <BtnStyle>Start</BtnStyle>
      <BtnStyle>회원가입/로그인</BtnStyle>
    </PagesWrap>
  );
};

const BtnStyle = styled.div`
  width: 17rem;
  height: 4rem;
  line-height: 4rem;
  font-size: 2rem;
  margin: 1rem;
`;

export default MainPage;
